import React from 'react';

export default function Header() {
    return (
        <>
            <div className="entrance neonText">
                Hey, I'm Michael. <br />
                I like dogs.
            </div>
            <span className="float-right"><img src="./images/self.png" alt="self portrait" height="300rem" width="300rem" />
            </span>
        </>
    )
}
